import React from 'react'
import {useState} from 'react'

const Pdf = ({pdf}) => {
    const [isEnterMouse,setIsEnterMouse]=useState(false);
    const handleBackground=state=>{
        setIsEnterMouse(state);
    }
    return (
        <div className={isEnterMouse?'background':''}
            onMouseEnter={()=>handleBackground(true)}
            onMouseLeave={()=>handleBackground(false)}
            style={isEnterMouse?{backgroundColor:'silver'}:{backgroundColor:'white'}}
        >   
            <div> 
                {/* <h2>{pdf.pdf_name}</h2>
                <a href={pdf.pdf_link}>{pdf.pdf_link}</a> */}
                <a href={pdf.pdf_link} target="_blank" rel="noopener noreferrer">{pdf.pdf_name}</a>
                {/* <p>{pdf.company_code+1}</p> */}
            </div>
        </div>
    )
}

export default Pdf
